import { StatusBar } from 'expo-status-bar';
import { StyleSheet, View, FlatList } from 'react-native';
import { Button, CheckBox, Input, Text } from '@rneui/themed';
import * as Font from 'expo-font';
import FontAwesome from '@expo/vector-icons/FontAwesome';
import { useEffect, useState } from 'react';
import { NavigationContainer } from '@react-navigation/native';
import { createNativeStackNavigator } from '@react-navigation/native-stack';
import { StackActions } from '@react-navigation/native';
import AsyncStorage from '@react-native-async-storage/async-storage';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
import * as React from 'react';

const Tab = createBottomTabNavigator()
const Stack = createNativeStackNavigator()

async function cacheFonts(fonts) {
  return fonts.map(async (font) => {await Font.loadAsync(font)})
}

let initTasks = [
  {description: "Dishes", key: "1", completed: false},
  {description: "Homework", key: "2", completed: false},
  {description: "Walk dog", key: "3", completed: false}
]

export default function App() {
  cacheFonts([FontAwesome.font])
  return (
    <NavigationContainer>{
      <Tab.Navigator>
        <Tab.Screen name="login" component={LoginScreen}></Tab.Screen>
        <Tab.Screen name="register" component={RegisterScreen}></Tab.Screen>
        <Tab.Screen name="todo" component={TodoScreen}></Tab.Screen>
      </Tab.Navigator>
    }</NavigationContainer>
  );
}

function LoginScreen() {
  return <Text>Sample</Text>
}

function RegisterScreen() {
  return <Text>Sample2</Text>
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
});
